function FormRegister() {
    let navigate = useNavigate();
    const [newStudent, setNewStudent] = useState({
        name: ''
    });
    const handleCreateStudent = () => {
        axios.post('http://localhost:8080/api/class/create', newStudent)
            .then(response => {
                alert('Class created successfully');
                navigate('/listClass')
            })
            .catch(error => {
                alert('An error occurred');
            });
    }
    const handleInputChange = (e) => {
        const fieldName = e.target.name;
        const fieldValue = e.target.value;
        setNewStudent(prevState => {
            return {
                ...prevState,
                [fieldName]: fieldValue
            };
        });
    }
    return(
        <div style={{width: "500px", margin: 'auto'}}>
            <h2 style={{ textAlign: 'center', marginTop: '10px' }}>{newStudent.id ? 'Edit Product' : 'Create Product'}</h2>
            <div className="mb-3">
                <label className="form-label">Name</label>
                <input className="form-control" type="text" name="name" onChange={handleInputChange} />
            </div>
            <button style={{ marginTop: '20px' }} className={"btn btn-primary"} onClick={handleCreateStudent}>Create</button><br/>
            <Link style={{marginTop: '40px'}} className="btn btn-info" to={'/'} >Back to list</Link>
        </div>
    )
}
export default FormRegister
